import React, { useState } from "react";
import './assets/bootstrap/css/bootstrap.min.css';
import './assets/css/vanilla-zoom.min.css';
import  { Link } from "react-router-dom";
import { Navbar } from './Navbar';


export const Register = (props) => {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [name, setName] = useState('');
    const [surname, setSurname] = useState('');
    const [phoneNo, setPhoneNo] = useState('');
    const [birthDate, setBirthDate] = useState("");
    const [gender, setGender] = useState("");
    const [successful, setSuccesful] = useState(false);
    const [isOpen, setIsOpen] = useState(false);

    const toggleDropdown = () => {
      setIsOpen(!isOpen);
    };
    const handleSelect = (event) => {
      console.log("inside here");
      setGender(event.target.value);
      setIsOpen(false);
    }
    const handleSubmit = (e) => {
        e.preventDefault();
        console.log(email);
    }

    return (
        <>
        <Navbar/>
        <main className="page registration-page">
          <section className="clean-block clean-form dark">
            <div className="container">
              <div className="block-heading">
                <h2 className="text-info">Registration</h2>
                <p>Please enter your information</p>
              </div>
              <form>
                <div className="mb-3">
                  <label className="form-label" htmlFor="name">
                    Name
                  </label>
                  <input className="form-control item" type="text" id="name" />
                </div>
                <div className="mb-3">
                  <label className="form-label" htmlFor="name">
                    Surname
                  </label>
                  <input className="form-control item" type="text" id="surname" />
                </div>
                <div className="mb-3">
                  <label className="form-label" htmlFor="email">
                    Telephone-no
                  </label>
                  <input className="form-control item" type="tel" id="phoneNo"/>
                </div>
                <div className="mb-3">
                  <label className="form-label" htmlFor="email">
                    Date of Birth
                  </label>
                  <input className="form-control" type="date" id="birthDate"/>
                </div>
                <div className="mb-3">
                  <label className="form-label" htmlFor="email">
                    Gender
                  </label>
                  <div className= {`dropdown ${isOpen ? ' show' : ''}`}>
                    <button
                      className="btn btn-primary dropdown-toggle"
                      aria-expanded="false"
                      data-bs-toggle="dropdown"
                      type="button"
                      onClick={toggleDropdown}
                      value={gender}
                      onChange={handleSelect}
                    >
                      Dropdown
                    </button>
                    <select
        className="form-select"
        id="gender"
        value={gender}
        onChange={handleSelect}
      >
        <option value="">Select gender</option>
        <option value="female">Female</option>
        <option value="male">Male</option>
      </select>

                  </div>
                </div>
                <div className="mb-3">
                  <label className="form-label" htmlFor="email">
                    Email
                  </label>
                  <input className="form-control item" onChange={(e) => setEmail(e.target.value)} type="email" id="email" />
                </div>
                <div className="mb-3">
                  <label className="form-label" htmlFor="password">
                    Password
                  </label>
                  <input
                    className="form-control item" onChange={(e) => setPassword(e.target.value)} type="password" id="password"/>
                </div>
                { successful && (
                  <Link to="">
                  <button className="btn btn-primary" type="submit">
                    Sign Up
                  </button>
                  </Link>
                )} { !successful && (
                  <Link to="">
                  <button className="btn btn-primary" type="submit">
                    Sign Up
                  </button>
                  </Link>
                )}

                <Link to="/">
                <button
                  className="btn btn-primary"
                  type="submit"
                  style={{ float: "right" }}
                >
                  LogIn
                </button>
                </Link>
              </form>
            </div>
          </section>
        </main>
      </>
    );


}
export default Register;
